import Paragrafos from './Componentes/Paragrafos';
import './App.scss';

import Navbar from './Componentes/Navbar';

import Sobre from './Componentes/Sobre';

function App() {
  return (
    <>
< BrowserRouter>
< Navbar/>
<Paragrafos></Paragrafos>
< Routes >
  <Route path='/' element={<Sobre />}/>
</Routes>
</BrowserRouter >





    </>

  );
}

export default App;
